    KoreWidgetSDK.prototype.cloneMessage1 = function (obj) {
        var _self = this;
        var rv;
        switch (kore_widgets_typeof(obj)) {
            case "object":
                if (obj === null) {
                    rv = null;
                }
                else {
                    switch (toString.call(obj)) {
                        case "[object Array]":
                            rv = obj.map(_self.cloneMessage1.bind(_self));
                            break;
                        case "[object Date]":
                            rv = new Date(obj);
                            break;
                        case "[object RegExp]":
                            rv = new RegExp(obj);
                            break;
                        default:
                            rv = Object.keys(obj).reduce(function (prev, key) {
                                prev[key] = _self.cloneMessage1(obj[key]);
                                return prev;
                            }, {});
                            break;
                    }
                }
                break;
            default:
                rv = obj;
                break;
        }
        return rv;
    };
